export const getFrequency = createAsyncThunk(
  'frequency/getFrequency',
  async (_, { dispatch }) => {
    try {
      const response = await axios.get(
        `http://oliver.energaming.systems:20035/api/v1/get-generic-info`,
        {
          params: {
            token: 'test-frontend-token',
            duration: 3,
            page: 0,
          },
        },
      );
      // const response = mockFrequencyData;
      const { hotBalls, coldBalls } = response.data.ballFrequency['100'];
      dispatch(
        setFrequency({
          hotNums: hotBalls.map(el => el[0]),
          coldNums: coldBalls.map(el => el[0]),
        }),
      );
      return true;
    } catch (error) {
      throw new Error('Error fetching limits data');
    }
  },
);
